import React from "react";
import './style.css';
import {Navbar,Container,Image} from 'react-bootstrap';
import cart from './cart.svg';
import "./market.css";

const Market = () => {
    return (
      <Navbar>
      <Container>
        <Navbar.Brand className="title ml-2 fw-bold float-start"> <h1>Skinlyst</h1> </Navbar.Brand>
        <Navbar.Toggle />
      </Container>
      <Container>
        <Navbar.Brand className="fw-bold">
          <Image src={cart} className="cart" />
        </Navbar.Brand>
      </Container>
    </Navbar>
    











    );
}

export default Market;
